<template>
  <button
    class="airdrop-card"
    @mouseenter="handleMouseEnter"
    @mouseleave="handleMouseLeave"
    @click="onClick"
  >
    <img :src="image" style="width: 100%;" />
  </button>
</template>
<script>
export default {
  name: "airdrop-card",
  data() {
    return {
      default:
        "data:image/png;base64,",
      rollover:
        "data:image/png;base64,",
      image:
        "data:image/png;base64,",
    };
  },
  methods: {
    handleMouseEnter() {
      this.image = this.rollover;
    },
    handleMouseLeave() {
      this.image = this.default;
    },
    onClick() {
      this.$emit("v-click");
    },
  },
};
</script>
<style scoped lang="scss">
.airdrop-card {
  background: transparent;
  padding: 0px;
  border: 0px;
  padding-bottom: 17.5px;
}
</style>
